class PersonMaker():

    def __init__(self, birth_year):

        self.birth_year = int(birth_year)
        self.birth_date = '-0000-00-00-'
        self.death_date = '-0000-00-00-'
        self.full_name = ''
        self.age_at_death = [0, 0, 0]
        self.gender = 'unknown'
        self.make_random_person()

    def make_random_person(self):

        gender = random.choice(GENDER)
        middle_qty = random.choice(MIDDLES)

        if gender == 0:
            first = random.choice(FEMALES)
            middle = random.choices(FEMALES, k=middle_qty)
            self.gender = 'female'
        else:
            first = random.choice(MALES)
            middle = random.choices(MALES, k=middle_qty)
            self.gender = 'male'
        middle = ' '.join(middle)

        last = random.choice(SURNAMES)

        full_name = '{} {} {}'.format(first, middle, last)
        self.full_name = full_name.replace('  ', ' ')

        self.make_dates()

    def make_dates(self):

        birth_month = random.randrange(1, 12)
        birth_day = random.randrange(1, 28)

        death_age_years = random.randrange(0, 110)
        death_age_months = random.randrange(0, 11)
        death_age_days = random.randrange(0, 28)

        age_at_death = [death_age_years, death_age_months, death_age_days]

        self.age_at_death = '{}y, {}m, {}d'.format(
            age_at_death[0], age_at_death[1], age_at_death[2])

        death_year = self.birth_year + death_age_years
        death_month = birth_month + death_age_months
        death_day = birth_day + death_age_days

        if death_month > 12:
            death_month = death_month - 12
        if death_day > 28:
            death_day = death_day - 28
            death_month = death_month + 1

        birth_month = self.add_zeroes(birth_month)
        birth_day = self.add_zeroes(birth_day)

        death_month = self.add_zeroes(death_month)
        death_day = self.add_zeroes(death_day)

        self.birth_date = '-{}-{}-{}-'.format(
            self.birth_year, birth_month, birth_day)
        self.death_date = '-{}-{}-{}-'.format(
            death_year, death_month, death_day)

    def add_zeroes(self, addee):

        if len(str(addee)) < 2:
            addee = str(addee)
            add_qty = 2 - len(addee)
            addee = '0' * add_qty + addee
            print(addee)

        return addee

